  document.querySelector("#root")
)





const home_ = ReactDOM.createRoot(document.getElementById('profile'));
home_.render(
  <React.StrictMode>
    <Homepage/>

  </React.StrictMode>
);


const Nav_ = ReactDOM.createRoot(document.getElementById('Nav_bar'));
Nav_.render(
  <React.StrictMode>
    <Nav />

  </React.StrictMode>
);
